import { useSelector } from "react-redux";

function UserCard() {
  const user = useSelector((state) => state.authReducer.user);
  return (
    <div className='cardroot'>
      <div class='card'>
        <h1>{user && user.name}</h1>
        <button>Delete</button>
      </div>
    </div>
  );
}
export default UserCard;
